import React, {useEffect, useState} from 'react';

import './App.css';

const App = () => {

  const APP_ID = "53b8faab";
  const API_KEY = "2c8fdbba1c9f80c0b35defb7a84113cf";

  const exampleReq = `https://api.edamam.com/search?q=chicken&app_id=${APP_ID}&app_key=${API_KEY}`;

  const[ counter, setCounter] = useState(0);

  useEffect(() => {
    console.log('effect has been run');
  });
  return(
    <div className="App">
      <form className="search-form">
        <input className="search-bar" type="text">
          <button onClick={() => setCounter(counter + 1)} className="search-button" type="submit">{counter}</button>
        </input>
      </form>
    </div>
  );
};

export default App;
